vertex.source:
#version 300 es

// Vertex position in object space coordinates
in vec3 vertexPosition;
// Surface normal at the vertex in object space coordinates
in vec3 vertexNormal;
// Texture coordinates at that vertex
in vec2 vertexTextureCoordinates;

out vec2 fragCord;
out vec3 fragPos;
out vec3 camPos;

// Model matrix
uniform mat4 mMatrix;
// View matrix
uniform mat4 vMatrix;
// Projection matrix
uniform mat4 pMatrix;

// Main program for each vertex
void main() {
  vec4 vertexCamSpace = vMatrix * mMatrix * vec4(vertexPosition, 1.0);
  gl_Position = pMatrix * vertexCamSpace;

  fragCord = vertexTextureCoordinates;
  fragPos = (mMatrix * vec4(vertexPosition, 1.0)).xyz;
  camPos = (inverse(vMatrix) * vec4(0.0, 0.0, 0.0, 1.0)).xyz;
}

fragment.source:
#version 300 es

// For better performance less precision
precision highp float;
uniform mat4 mMatrix;
in vec2 fragCord;
in vec3 fragPos;
in vec3 camPos;

uniform vec3 lightDirection;
uniform vec3 lightColor;
uniform float kA; // 0.5
uniform float kD; // 1.0
uniform float kS; // 0.5
uniform float s; // 20
uniform float Ia; // 0.5

out vec4 fragColor;

uniform sampler2D colorMap;
uniform sampler2D normalMap;
uniform sampler2D ambientMap;
uniform sampler2D roughnessMap;
uniform sampler2D heightMap;

vec2 parallaxMapping(vec2 texCoords, vec3 viewDir) { 
    const float heightScale = 0.1;

    // number of depth layers
    const float minLayers = 16.0;
    const float maxLayers = 256.0;
    float numLayers = mix(maxLayers, minLayers, max(dot(vec3(0.0, 0.0, 1.0), viewDir), 0.0));  
    // calculate the size of each layer
    float layerDepth = 1.0 / numLayers;
    // depth of current layer
    float currentLayerDepth = 0.0;
    // the amount to shift the texture coordinates per layer (from vector P)
    vec2 P = viewDir.xy * heightScale; 
    vec2 deltaTexCoords = P / numLayers;

    // get initial values
    vec2 currentTexCoords = texCoords;
    float currentDepthMapValue = texture(heightMap, currentTexCoords).r;

    while(currentLayerDepth < currentDepthMapValue) {
        // shift texture coordinates along direction of P
        currentTexCoords -= deltaTexCoords;
        // get depthmap value at current texture coordinates
        currentDepthMapValue = texture(heightMap, currentTexCoords).r;  
        // get depth of next layer
        currentLayerDepth += layerDepth;  
    }

    // get texture coordinates before collision (reverse operations)
    vec2 prevTexCoords = currentTexCoords + deltaTexCoords;

    // get depth after and before collision for linear interpolation
    float afterDepth  = currentDepthMapValue - currentLayerDepth;
    float beforeDepth = texture(heightMap, prevTexCoords).r - currentLayerDepth + layerDepth;

    // interpolation of texture coordinates
    float weight = afterDepth / (afterDepth - beforeDepth);
    vec2 finalTexCoords = prevTexCoords * weight + currentTexCoords * (1.0 - weight);

    return finalTexCoords;  
}

// Main program for each fragment = pixel candidate
void main() {

    vec3 l = normalize(lightDirection);
    vec3 v = normalize(camPos - fragPos);

    // Recalculated coordinates using parallaxMapping
    vec2 texCoords = parallaxMapping(fragCord, vec3(-v.x, v.z, v.y));

    vec3 baseColor = texture(colorMap, texCoords).xyz;
    vec3 h = normalize(v + l);
    vec3 n = normalize((transpose(inverse(mMatrix)) * 
        vec4(normalize(texture(normalMap, texCoords).xyz * 2.0 - vec3(1.0)), 0.0)).xyz);

    float Ia = texture(ambientMap, texCoords).x;
    float r = texture(roughnessMap, texCoords).x;

    float Id = clamp(abs(dot(n, l)), 0.0, 1.0);
    float Is = pow(clamp(abs(dot(n, h)), 0.0, 1.0), s * r);
    vec3 color = ((kA * Ia + kD * Id) * baseColor + (kS * Is)) * lightColor;

    fragColor = vec4(color, 1.0);
}

vertex.source:
#version 300 es

// Vertex coordinates in object space for the render quad
in vec3 vertexPosition;
// Texture coordinate for this vertex and the render quad
in vec2 vertexTextureCoordinates;

// Texture coordinate needs to be passed on to the R2T fragment shader
out vec2 fragmentTextureCoordinates;

// Main program for each vertex of the render quad
void main() {
  gl_Position = vec4(vertexPosition, 1.0);
  fragmentTextureCoordinates = vertexTextureCoordinates;
}

fragment.source:
#version 300 es

precision highp float;

// A texture sampling unit, which is bound to the render quad texture buffer
uniform sampler2D textureRendered;

// Texture coordinates coming from the vertex shader, interpolated through the rasterizer
in vec2 fragmentTextureCoordinates;
out vec4 fragColor;

// Main program for each fragment of the render quad
void main() {
  fragColor = texture(textureRendered, fragmentTextureCoordinates.st);
}
